import './App.css';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import RecipesPage from './pages/RecipesPage';
import About from './pages/About';
import Footer from './components/Footer';
import HummusPasta from './pages/HummusPasta';
import GreenSmoothie from './pages/GreenSmoothie';
import VegNoodleSoup from './pages/VegNoodleSoup';
import VietNoodleSalad from './pages/VietNoodleSalad';
import Contact from './pages/Contact';
import { RecipeList } from './data/RecipeList.js';

function App() {
  return (
    <div className="App">
      {RecipeList.map((recipe) => {
            return(
              <BrowserRouter>
              <Routes>
              <Route path={recipe.link} element={<RecipesPage 
                name={recipe.name}
                image={recipe.image}
                time={recipe.time}
                desc={recipe.desc}
              />}/>
              </Routes>
              </BrowserRouter>
            );
          })}
    </div>
  );
}

export default App;
